import {
  IonBackButton,
  IonButton,
  IonButtons,
  IonCol,
  IonContent,
  IonGrid,
  IonHeader,
  IonInput,
  IonItem,
  IonLabel,
  IonPage,
  IonRow,
  IonTitle,
  IonToolbar,
} from "@ionic/react";
import React from "react";
import AdminForm from "../../components/Forms/AdminForm";

const SignUp: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Sign Up</IonTitle>
          <IonButtons slot="start">
            <IonBackButton defaultHref="/signIn" />
          </IonButtons>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <AdminForm buttonName="Sign Up"/>
      </IonContent>
    </IonPage>
  );
};

export default SignUp;
